import React, {useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';

import ReactExport from "react-export-excel";

const ExcelFile = ReactExport.ExcelFile;
const ExcelSheet = ReactExport.ExcelFile.ExcelSheet;
const ExcelColumn = ReactExport.ExcelFile.ExcelColumn;

const dataSet1 = [
  {
      name: "Johson",
      amount: 30000,
      sex: 'M',
      is_married: true
  },
  {
      name: "Monika",
      amount: 355000,
      sex: 'F',
      is_married: false
  },
  {
      name: "John",
      amount: 250000,
      sex: 'M',
      is_married: false
  },
  {
      name: "Josef",
      amount: 450500,
      sex: 'M',
      is_married: true
  }
];

class Download extends React.Component {
  render() {
      return (
          <ExcelFile> element={<button>Download Data</button>}>
              <ExcelSheet data={dataSet1} name="Employees">
                  <ExcelColumn label="Question - max 120 characters" value="question"/>
                  <ExcelColumn label="Answer 1 - max 75 characters" value="answer"/>
                  <ExcelColumn label="Answer 2 - max 75 characters" value="answer"/>
                  <ExcelColumn label="Answer 3 - max 75 characters" value="answer"/>
                  <ExcelColumn label="Answer 4 - max 75 characters" value="answer"/>
                  <ExcelColumn label="Time limit (sec) â€“ 5, 10, 20, 30, 60, 90, 120, or 240 secs" value="time"/>
                  <ExcelColumn label="Correct answer(s) - choose at least one" value="correct"/>
              </ExcelSheet>

          </ExcelFile>
      );
  }
}

const obj_json = {a: 123, b: "4 5 6"};
const data_json = "text/json;charset=utf-8," + encodeURIComponent(JSON.stringify(obj_json));

function App() {
  const [ headerName, setHeaderName ] = useState('')
  useEffect(()=> {
    fetch('http://0.0.0.0:8000/')
    .then((response) => response.json())
    .then((json) => {
      console.log(json);
      setHeaderName(json.Hello)
    })
    .catch((error) => {
      console.error(error);
    });
  })
  const handleUploadFile = (event) =>{
    const file = event.target.files[0]

    const reader = new FileReader();
    reader.onload = function(e) {
      const contents = e.target.result;
      console.log('cont ', contents);

      fetch('http://0.0.0.0:8000/interrogate', {
        method: 'POST',
        headers: {
          'accept': 'application/json',
          'content-type': 'application/json',
        },
        body: JSON.stringify(({
          data: contents
        }))
      })
    };
    reader.readAsText(file);

  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <p>
          {headerName}
        </p>
        <div>
          <input type='file'onChange={handleUploadFile}/>
        </div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
